import React from 'react';
//import SvgIcon from '@material-ui/core/SvgIcon';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
//import ListSubheader from '@material-ui/core/ListSubheader';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart'
import RestaurantIcon from '@material-ui/icons/Restaurant';
import MotorcycleIcon from '@material-ui/icons/Motorcycle';
//import PeopleIcon from '@material-ui/icons/People';
import BarChartIcon from '@material-ui/icons/BarChart';
//import LayersIcon from '@material-ui/icons/Layers';
//import AssignmentIcon from '@material-ui/icons/Assignment';

//import { Link ,withRouter,NavLink} from 'react-router-dom';
import { NavLink} from 'react-router-dom';

const MainListItems = React.forwardRef((props, ref) =>  {

  const AdapterLink = React.forwardRef((props, ref) => {
    return(<Link innerRef={ref} {...props} />)
  })

  return (
  <div {...props} ref={ref} >
    <ListItem button component={AdapterLink} to="/ordering">
      <ListItemIcon>
        <ShoppingCartIcon />
      </ListItemIcon>
      <ListItemText primary="Ordering List" />
    </ListItem>
    <ListItem button component={AdapterLink} to="/order_ready">
      <ListItemIcon>
        <RestaurantIcon />
      </ListItemIcon>
      <ListItemText primary="Order Ready" />
    </ListItem>
    <ListItem button component={AdapterLink} to="/driver_ready">
      <ListItemIcon>
        <MotorcycleIcon />
      </ListItemIcon>
      <ListItemText primary="Driver Ready" />
    </ListItem>
    <ListItem button>
      <ListItemIcon>
        <BarChartIcon />
      </ListItemIcon>
      <ListItemText primary="Reports" />
    </ListItem>
  </div>
  );
});

export default MainListItems;

